pragma solidity 0.8.7;

contract Factory {
    event Deployed(address _addr);
    function deploy(uint salt, bytes calldata bytecode) public {
        bytes memory implInitCode = bytecode;
        address addr;
        assembly {
            let encoded_data := add(0x20, implInitCode) // Load init code
            let encoded_size := mload(implInitCode) // Load init codes length
            addr := create2(0, encoded_data, encoded_size, salt)
        }
        emit Deployed(addr);
    }
}

contract NoConstructor {
    uint public myUint = 5;
}
